import React, { Component } from "react";
import { MDBContainer, MDBMask, MDBView } from "mdbreact";
import { storage } from "./index";
import FooterPage from "./footer.js";
const backGroundVideo =
  "https://firebasestorage.googleapis.com/v0/b/socialtrip-f5408.appspot.com/o/BackGround%20Video%2FBirdNoSound.mp4?alt=media&token=d10c00ff-193d-4c33-8805-75ab089f7107";
class main extends Component {
  render() {
    return (
      <div>
        <MDBView>
          <video
            height={500}
            width
            lassName="videoTag"
            autoPlay="autoplay"
            loop="loop"
            muted
          >
            <source src={backGroundVideo} type="video/mp4" />
          </video>
        </MDBView>
        <main>
          <MDBContainer className="text-center my-5"></MDBContainer>
        </main>
        <FooterPage />
      </div>
    );
  }
}

export default main;
